import React, { useState, useEffect } from "react";
import RecipeSearch from "./RecipeSearch";
import axios from "axios";

function RecipeApp() {
  // https://developer.edamam.com/ - where we are getting from the API
  const APP_ID = "0a6f51df";
  const APP_KEY = "e0dab08929946848bd8a70fa38f7dca3";

  const req = `https://api.edamam.com/search?q=chicken&app_id=${APP_ID}&app_key=${APP_KEY}`;

  useEffect(async () => {
    const response = await axios.get(req);
    const data = response.data;
    console.log(data);
  }, []);

  return (
    <div>
      <h1>Recipe App</h1>
      <RecipeSearch />
    </div>
  );
}

export default RecipeApp;

